import React, { Component } from 'react';
import Ticker from './components/Ticker';

class App extends Component {
    render() {
        console.log(this.state.todos);
        return (
            <div className='App'>
                <Ticker todos = {this.state.todos} />
            </div>
        )
    }
}

export default App;
